import React from 'react';
import './preview.css';

const Preview = () => {
    return (
        //<h2 className="preview">Wellcome to : <br />FicusTest</h2>
        <div class="sk-cube-grid">
            <div class="sk-cube sk-cube1">W</div>
            <div class="sk-cube sk-cube2">E</div>
            <div class="sk-cube sk-cube3">L</div>
            <div class="sk-cube sk-cube4">L</div>
            <div class="sk-cube sk-cube5">C</div>
            <div class="sk-cube sk-cube6">O</div>
            <div class="sk-cube sk-cube7">M</div>
            <div class="sk-cube sk-cube8">E</div>
            {/*<div class="sk-cube sk-cube9"></div>*/}
        </div>
    )
}

export default Preview;
